import React from "react";
import styles from "./users.module.css"

const Users = (props) => {
    if (props.users.length === 0){
        props.setUsers(
            [
                {id: 1, photoUrl:"https://cdn.pixabay.com/photo/2017/01/31/21/23/avatar-2027366__340.png", followed: false, fullname:"Ilyas", status:"i'm a proger", location:{city:"Almaty", country:"Kazakhstan"}},
                {id: 2, photoUrl:"https://cdn.pixabay.com/photo/2017/01/31/21/23/avatar-2027366__340.png", followed: true, fullname:"Vladimir", status:"i'm a man", location:{city:"Moscow", country:"Russia"}},
                {id: 3, photoUrl:"https://cdn.pixabay.com/photo/2017/01/31/21/23/avatar-2027366__340.png", followed: false, fullname:"Ali", status:"Pypsik", location:{city:"Bishkek", country:"Kirgizstan"}},
            ]
        );
    }
    
    return<div>
            {
                props.users.map(u => <div key={u.id}>
                    <span>
                        <div>
                            <img src={u.photoUrl} className={styles.userPhoto}/>
                        </div>
                        <div>
                            {u.followed ? <button onClick={() => {props.unfollow(u.id)}}>unFollow</button> : <button onClick={() => {props.follow(u.id)}}>Follow</button>}
                            
                        </div>
                    </span>
                    <span>
                        <span>
                            <div>{u.fullname}</div>
                            <div>{u.status}</div>
                        </span>
                        <span>
                            <div>{u.location.country}</div>
                            <div>{u.location.city}</div>
                        </span>
                    </span>
                </div>)
            }
        </div>
}
export default Users;
